import React from 'react';
import { Link } from 'react-router-dom';

const NotFound = () => (
  <div>
    <h1 style={{textAlign: 'center'}}>404 - Not Found!</h1>
    <Link to="/" className="btn btn-default text-light" style={{textAlign: 'center'}}>
                Go Back To Search
              </Link>
  </div>
);

export default NotFound;
